export const cloneObject = (obj) => {
  var clone = {}
  for (var i in obj) {
    if (typeof (obj[i]) === 'object' && obj[i] != null) { clone[i] = cloneObject(obj[i]) } else { clone[i] = obj[i] }
  }
  return clone
}
